import React from "react";
import Navbar from "../../components/navbar/Navbar";

export default function ViewStudent() {
  return (
    <>
      <Navbar />
      <div className="container-fluid p-5" style={{ backgroundColor: "#f7f7fa" }}>
        <div className="mx-auto bg-white border rounded mt-5" style={{ width: "30%" }}>
          <div style={{ height: "80px", background: "grey" }}></div>
          <div className="p-4" style={{ height: "300px", textAlign: "center" }}>
            <ul class="list-group">
              <li class="list-group-item"><span style={{color:"grey"}}>Full Name:</span></li>
              <li class="list-group-item">Roll Number:</li>
              <li class="list-group-item">Class:</li>
              <li class="list-group-item">Age:</li>
              <li class="list-group-item">Gender:</li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
}
